"""Utilities unit tests."""
from os import environ, remove
from base64 import b64encode
from boto3 import client
from botocore.errorfactory import ClientError

from dapp_store_backend.utilities import move_s3, move_recursive_s3, upload_image_to_s3
from dapp_store_backend.enums.status import HTTPCodes


s3_client = client('s3',
                   aws_access_key_id=environ['AWS_ACCESS_KEY_ID'],
                   aws_secret_access_key=environ['AWS_SECRET_ACCESS_KEY'])

bucket = environ['S3_BUCKET_NAME']

b64_string = b''
file_type = 'jpeg'


def test_upload_image_to_s3():
    """
    Test upload image to s3
    :return:
    """

    image_name = upload_image_to_s3(s3_client, bucket, b64_string, file_type)
    s3_client.download_file(bucket, image_name, './downloaded_image.jpeg')

    with open('downloaded_image.jpeg', 'rb') as f:
        new_str = b64encode(f.read())

    remove('downloaded_image.jpeg')

    assert b64_string == new_str


def test_move_s3():
    """
    Test upload image to S3, move image in same bucket, delete old image
    :return:
    """

    image_name = upload_image_to_s3(s3_client, bucket, b64_string, file_type)
    new_image_path = move_s3(s3_client, bucket, image_name, 'moved_image.jpeg')

    status_code = 0
    try:
        s3_client.head_object(Bucket=bucket, Key=image_name)
    except ClientError as e:
        status_code = e.response['ResponseMetadata']['HTTPStatusCode']

    s3_client.download_file(bucket, new_image_path, 'moved_image.jpeg')

    with open('moved_image.jpeg', 'rb') as f:
        new_str = b64encode(f.read())

    assert status_code == HTTPCodes.Not_Found.value
    assert b64_string == new_str


def test_move_recursive_s3():
    """
    Test recursively moving files in the same bucket
    :return:
    """
    folder_name = 'test_folder'
    new_folder_name = 'new_folder'

    image_names = [
        upload_image_to_s3(s3_client, bucket, b64_string, file_type,
                           path=folder_name),
        upload_image_to_s3(s3_client, bucket, b64_string, file_type,
                           path=f'{folder_name}/subfolder1'),
        upload_image_to_s3(s3_client, bucket, b64_string, file_type,
                           path=f'{folder_name}/subfolder2'),
        upload_image_to_s3(s3_client, bucket, b64_string, file_type,
                           path=f'{folder_name}/subfolder2')
    ]

    new_images = move_recursive_s3(s3_client, bucket, folder_name, new_folder_name)

    status_codes = []
    for img in image_names:
        try:
            s3_client.head_object(Bucket=bucket, Key=img)
        except ClientError as e:
            status_codes.append(e.response['ResponseMetadata']['HTTPStatusCode'])

    s3_client.download_file(bucket, new_images[3], 'recursively_moved_image.jpeg')

    with open('recursively_moved_image.jpeg', 'rb') as f:
        new_str = b64encode(f.read())

    assert all(code == HTTPCodes.Not_Found.value for code in status_codes)
    assert b64_string == new_str
